import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Dashboard from "./pages/Dashboard";
import Stocks from "./pages/Stocks";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Navbar from "./pages/Navbar";
import VirtualPortfolios from "./pages/VirtualPortfolios";
import BuySellStocks from "./pages/BuySellStocks";
import TradingTutorials from "./pages/TradingTutorials";
import Profile from "./pages/Profile";
import MockCompetitions from "./pages/MockCompetitions";
import ProtectedRoute from "./pages/protectedroute";


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route
  path="/dashboard"
  element={
    <ProtectedRoute>
      <Dashboard />
    </ProtectedRoute>
  }
/>        <Route path="/stocks" element={<Stocks />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/Navbar" element={<Navbar />} />
        <Route path="/portfolio" element={<VirtualPortfolios />} />
        <Route path="/market" element={<BuySellStocks />} />
        <Route path="/tutorials" element={<TradingTutorials />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/mock" element={<MockCompetitions />} />

      </Routes>
    </Router>
  );
}

export default App;
